import React, {Component} from 'react';
import './Checkbox.css'

class Checkbox extends Component {

    render() {
        let {isDisplay, message} = this.state;
        return (
            <div>
                <label className="control control--checkbox">
                    <input type="checkbox"/>
                    <div className="control__indicator"/>
                </label>
            </div>
        );
    }
}

export default Checkbox;
